import React from 'react';
import { Link } from "react-router-dom";
import profile from '../../media/images/conan.png'

function InboxItem(props) {
    return (
        <div className={`conversation flex rel aic`}>
            <div className={`you rel flex aic`}>
                <Link to="#" className={`user`}>
                    <img src={profile} height="50" width="50"/>
                </Link>
            </div>
            <div className={`meta rel flex col`}>
                <h2 className={`name s16 b wordwrap`}>Conan Edogawa</h2>
                <h2 className={`last-msg s15 c777`}>The strong one doesn't win. The one that wins is strong.</h2>
            </div>
            <div className={`extra rel flex col`}>
                <h2 className={`name s13 c777`}>Just Now</h2>
                <div className={`badge rel s14 cfff`}>
                    99+
                </div>
            </div>
        </div>
    );
}

export default InboxItem;
